import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.png';
import Typewriter from '../Typewriter/typewriter';

function Home(){
  return (
    <section id="intro">
      <div className="rectbox">
        <div className="imgcontainer">
        <img src={imgme} alt="Me" className="photoofme" />
        </div>
        <span className="nameinbox">RUDRAKSHA SINGH</span>
      </div>
      <div className="hometext"><Typewriter text="I am rudraksha" delay={1000}></Typewriter></div>
    </section>
  );
}

export default Home;
